import React from 'react';
import './MapPage.css';

const animalLocations = [
    {
        name: "Bengal Tiger",
        coordinates: "79.4082, 21.2945",
        imageUrl: "https://example.com/bengal_tiger.jpg", // Replace with actual image URL
        mapSrc: "https://www.google.com/maps/embed?pb=!1m17!1m12!1m3!1d733.3711952047123!2d21.291925078561626!3d79.40819998954599!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m2!1m1!2zNznCsDI0JzI5LjUiTiAyMcKwMTcnNDAuMiJF!5e0!3m2!1sen!2sin!4v1729960542273!5m2!1sen!2sin"
    },
    {
        name: "Asian Elephant",
        coordinates: "77.8809, 11.5860",
        imageUrl: "https://example.com/asian_elephant.jpg", // Replace with actual image URL
        mapSrc: "https://www.google.com/maps/embed?pb=!1m17!1m12!1m3!1d733.3711952047123!2d11.5860!3d77.8809!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m2!1m1!2zNznCsDI0JzI5LjUiTiAyMcKwMTcnNDAuMiJF!5e0!3m2!1sen!2sin!4v1729960542273!5m2!1sen!2sin"
    },
    {
        name: "Indian Rhino",
        coordinates: "93.3656, 26.0950",
        imageUrl: "https://example.com/indian_rhino.jpg", // Replace with actual image URL
        mapSrc: "https://www.google.com/maps/embed?pb=!1m17!1m12!1m3!1d733.3711952047123!2d26.0950!3d93.3656!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m2!1m1!2zNznCsDI0JzI5LjUiTiAyMcKwMTcnNDAuMiJF!5e0!3m2!1sen!2sin!4v1729960542273!5m2!1sen!2sin"
    },
    {
        name: "Snow Leopard",
        coordinates: "78.7320, 32.6512",
        imageUrl: "https://example.com/snow_leopard.jpg", // Replace with actual image URL
        mapSrc: "https://www.google.com/maps/embed?pb=!1m17!1m12!1m3!1d733.3711952047123!2d32.6512!3d78.7320!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m2!1m1!2zNznCsDI0JzI5LjUiTiAyMcKwMTcnNDAuMiJF!5e0!3m2!1sen!2sin!4v1729960542273!5m2!1sen!2sin"
    },
    {
        name: "Great Indian Bustard",
        coordinates: "70.7211, 26.0960",
        imageUrl: "https://example.com/great_indian_bustard.jpg", // Replace with actual image URL
        mapSrc: "https://www.google.com/maps/embed?pb=!1m17!1m12!1m3!1d733.3711952047123!2d26.0960!3d70.7211!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m2!1m1!2zNznCsDI0JzI5LjUiTiAyMcKwMTcnNDAuMiJF!5e0!3m2!1sen!2sin!4v1729960542273!5m2!1sen!2sin"
    },
];

const MapPage = () => {
    return (
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', padding: '20px' }}>
            {animalLocations.map((animal, index) => (
                <div key={index} style={{ margin: '20px', textAlign: 'center' }}>
                    <h3>{animal.name}</h3>
                    <img src={animal.imageUrl} alt={animal.name} style={{ width: '100px', height: 'auto' }} />
                    <iframe
                        src={animal.mapSrc}
                        width="600"
                        height="450"
                        style={{ border: 0 }}
                        allowFullScreen
                        loading="lazy"
                        referrerPolicy="no-referrer-when-downgrade"
                    />
                </div>
            ))}
        </div>
    );
};

export default MapPage;
